import React from 'react';


function Cards(){

	return(
		<>
			<div className="bmsCards">
				<div className="bmsCard">
					<img src="https://in.bmscdn.com/discovery-catalog/events/et00047164-ndumsyxpnh-portrait.jpg" alt="myPic" className="bmsCard_img" />
					<div className="card_info">
						<span className="bmsCard_category">A BookMyShow Orignal Series</span>
						<h3 className="title">Zack Snyder's Justice League</h3>
						<a href="https://in.bookmyshow.com/movies/zack-snyders-justice-league/ET00047164" target=""> <button>Watch Now</button> </a>
					</div>
				</div>
			</div>
		</>
		)
}

export default Cards;
